import React from 'react';

import { connect } from 'react-redux';
import { setLoginModalWindow } from '../../redux/actions';

import './auth.css';

const Auth = ({ setLoginModalWindow, isAuthenticated }) => {

    console.log(isAuthenticated);
    const handleLoginButtonClick = e => {
        e.preventDefault();
        setLoginModalWindow(true);
    }

    return (
        <ul className="auth-list">
            {
                
            }
            <li className="auth-list__item">
                <button
                    className="auth-list__button"
                    onClick={handleLoginButtonClick}>Вход</button>
            </li>
            <li className="auth-list__item">
                <button className="auth-list__button auth-list__button--reg">Регистрация</button>
            </li>

            <li class="auth-list__item">
                <a class="auth-list__button">Выйти</a>
            </li>
        </ul>
    )
}

const mapStateToProps = state => {
    return {
        isAuthenticated: state.auth.isAuthenticated
    }
}

export default connect(mapStateToProps, { setLoginModalWindow })(Auth);
